import {useState, useEffect} from 'react';
import { useNavigate } from 'react-router-dom';
import { searchScryfall } from '../tools/fetches.js';
import { getMappedPlaneList } from '../tools/utils.js';
import { planeImages } from '../tools/consts.js';

export default function MakePlanarDeck() {
  //input for scryfall search
  //make var to send to newSession router with planes
  // it will check there if that is populated

  function updateSearchText(event) {
    const searchVal = event.target.value;
    setSearchText(searchVal);
  }

  function handleScryfallSubmit() {
    const results = searchScryfall(searchText);
    console.log('results: ' + results);
  }

  const [searchText, setSearchText] = useState('');

  return (
    <div className='Scryfall'>
      <input className='Scryfall Input' placeholder='Enter your scryfall search terms' onChange={event => updateSearchText(event)} />
      <button className='Scryfall Submit' onClick={handleScryfallSubmit}>Search</button>
    </div>
  )
}
